import React, { Component } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  background: palevioletred;
  display: flex;
  justify-content: space-between;
  img {
    width: 250px;
    height: 50%;
  }
`;

class Home extends Component {
  render() {
    return (
      <Container>
        <div>
          <p>signup form</p>
        </div>
        <div>
          <img
            src="https://www.statnews.com/wp-content/uploads/2019/08/AdobeStock_182445295-645x645.jpeg"
            alt="Picture"
          />
        </div>
      </Container>
    );
  }
}

export default Home;
